    return (
        <Card className={classes.root}>
            <CardContent>
                <Typography component="p" variant="h3" className={classes.number}>
                    {number}
                </Typography>
                <Typography component="p">
                    {information}
                </Typography>
            </CardContent>
        </Card>
    );
};

export default PercentageCard;
